import React from 'react';
import { Link } from 'react-router-dom';
import './Nav.css';
const Nav = (props) => {
    return (
        <nav className="nav">
            <ul className="nav_ul">
                <li className="logo"><Link to="/">Logo</Link></li>
                <li className="nav-lgsn">Login</li>
                <li className="nav-lgsn">Signup</li>
                <li className="nav-lgsn">Blogs</li>
            </ul>
        </nav>
    );
}

export default Nav;
